import {TouchableOpacity, Text, Image, View} from 'react-native';
import { StyleSheet } from "react-native-web"

export default function BtnFinalizar(props) {
    const { onPress } = props;

    return(
        <TouchableOpacity style={{display: 'flex', flexDirection: 'row', width: 200, alignItems: "center", padding: 20, backgroundColor: "#53693C"}} onPress={() => onPress()}>
            <Text>Finalizar Compromisso</Text>
        </TouchableOpacity>
    )
}
